      <div class="CardBox">
        <h3>--- Plans ---</h3>
        <form>
          <label>Description:</label>
          <input type="text" />
          <label>Date for plan:</label>
          <select name="Day" id="Day">
            <option value="01">01</option>
          </select>
          <select name="Month" id="Month">
            <option value="Jan">Jan√∫ar</option>
